if (rts_org_ids.length > 0) {
	utag_data["cart_rts_organization_id"] = rts_org_ids;
	utag_data["cart_rts_course_id"] = rts_course_ids;
}

function customerType(number, isPunchout) {

	var type = "";
	
	if (isPunchout == 'true') {
		type = "Punchout";
	} else {
		if (number == 1) {
			if (email) {
				type = "B2C - Registered";
			} else {
				type = "B2C - Guest";
			}
		}
		if (number == 2) {
			type = "B2I";
		}
		if (number == 3) {
			type = "International";
		}	
	}
	return type;
}

